import React from "react";
import MuzicaPopBody from "./MuzicaPopBody.jsx";
import background from "./../../media/images/BK/Concert7.jpg";

const MuzicaPop = () => {
  return (
    <>
      <div style={{ backgroundImage: `url(${background})` }}>
        <h1 class="row d-flex justify-content-center mt-5 mb-5">Muzica Pop</h1>

        <MuzicaPopBody></MuzicaPopBody>
      </div>
    </>
  );
};

export default MuzicaPop;
